g.title:
"The Japan Head Tolerance Curve, the lower curve in
Fig. 1, shows the threshold combinations of impact
acceleration and duration for concussion;
accelerations above the curve cause concussion
whereas those below do not (Ono et al., 1980;
McLean & Anderson, 1997)."

